function runTest()
{
    FBTest.sysout("issue6557.START");

    FBTest.openNewTab(basePath + "html/style/6557/issue6557.html", function(win)
    {
        FBTest.openFirebug();
        var panel = FBTest.selectPanel("html");
        var sidePanel = FBTest.selectSidePanel("css");

        var tasks = new FBTest.TaskList();

        var [remotefont, localfont] = win.document.querySelectorAll("#remotefont, #localfont");

        tasks.push(FBTest.selectElementInHtmlPanel.bind(null, remotefont));
        tasks.push(previewFontFamily, sidePanel, "Konstytucyja", base64Konstytucyja);

        tasks.push(FBTest.selectElementInHtmlPanel.bind(null, localfont));
        tasks.push(previewFontFamily, sidePanel, "DeLarge", base64DeLarge);

        tasks.run(function()
        {
            FBTest.testDone("issue6557.DONE");
        });
    });
}

function previewFontFamily(callback, sidePanel, fontName, expectedBase64)
{
    var cssPropValueUsed = sidePanel.document.querySelector(".cssPropValueUsed");
    FBTest.mouseOver(cssPropValueUsed);

    var testInfoTip = function(infoTip)
    {
        var style = infoTip.querySelector("style");
        var resFontSearch = /data:[^,]*,([^'")]*)/.exec(style.innerHTML);
        if (!resFontSearch)
        {
            FBTest.ok(false, "Can't get the used font for preview");
            callback();
            return;
        }

        FBTest.compare(expectedBase64, resFontSearch[1],
            "The preview should show the " + fontName + " font for preview");

        callback();
    };

    var infoTip = sidePanel.document.querySelector(".infoTipFontFamilyBox");

    if (infoTip)
    {
        testInfoTip(infoTip);
    }
    else
    {
        var config = {tagName: "div", classes: "infoTipFontFamilyBox"};
        FBTest.waitForDisplayedElement("css", config, testInfoTip);
    }
}



var base64Konstytucyja = "";

var base64DeLarge = "";
